import styled from 'styled-components';

export default function Home(){
    return(
        <Container>
            <Welcome>
                <Hello>Olá, fulano</Hello>
                <Exit></Exit>
            </Welcome>
            <Register>
                <Text>Não há registros de<br/>entrada ou saída</Text>
            </Register>
            <Buttons>
                <Button>
                    <h6>Nova entrada</h6>
                </Button>
                <Button>
                    <h6>Nova saída</h6>
                </Button>
            </Buttons>
        </Container>
    )
}

const Container = styled.div`
    width: 100%;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    height: 100vh;
`

const Welcome = styled.div`
    display: flex;
    width: 80vw;
    flex-direction: row;
    justify-content: center;
    align-items: center;
    margin-bottom: 22px;
`

const Hello = styled.h3`
    color: #ffffff;
    font-size: 26px;
    font-weight: 700;
    font-family: var(--font-body);
`

const Exit = styled.div`
    height: 100%;
    color: #ffffff;
`

const Register = styled.div`
    width: 80vw;
    height: 446px;
    background-color: #ffffff;
    color: #868686;
    font-size: 20px;
    font-weight: 400;
    font-family: var(--font-body);
    border-radius: 5px;
    border: 1px solid #ffffff;
    display: flex;
    align-items: center;
    justify-content: center;
`

const Text = styled.h6`
    font-size: 20px;
    font-weight: 400;
    color: #868686;
    font-family: var(--font-body);
    text-align: center;
    line-height: 23.5px;
`

const Button = styled.div`
    width: 35vw;
    height: 114px;
    background-color: var(--color-button);
    color: #ffffff;
    font-size: 17px;
    font-family: var(--font-body);
    font-weight: 700;
    line-height: 20px;
    text-align: left;
    display: flex;
    justify-content: flex-start;
    align-items: flex-start;
    padding: 10px;
    border-radius: 5px;
    border: 1px solid var(--color-button)
`

const Buttons = styled.div`
    width: 80vw;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
`
